 ('225', '263', 'en_us', 'Contact', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2018-12-26 18:21:16', '2018-12-26 18:26:28', '783796cc-f9d7-4703-ac74-8a7bc5aadb9e'),
 ('226', '264', 'en_us', 'About Page', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, '0.0', '#000000', '#ffffff', NULL, 'Raised in Beijing China, Xiaoxiao now works based in New York, as a freelance compositor and motion graphics artist with brand list including Google, Amazon, Apple, Dell, Samsung, Bosch, Ford, McDonald’s, ESPN, Nickelodeon, Cartoon Network, Sesame Studios, VH1 TV, Hanes, Footlocker, CVS, Navy Federal Credit Union, etc. Her animated film \"Rock is not an Attitude\" has been official selected and screened in numerous international festivals, including ANIMAYO International Film Festival, Athens International Film Festival, CutOut Fest, 56th Zlín Film Festival, Brooklyn Film Festival, Adobe Design Achievement Awards to name a few. When creating as an independent artist, Xiaoxiao loves stop-motion animation and is particularly interested in its ability to allow a deeper expression based on its direct physical foundation.', '<div class=\"about-brief-text-row-1\">Hi, My name is <div class=\"about-brief-name\">Xiaoxiao Tang</div>, a Multimedia Artist</div>\r\n<div class=\"about-brief-text-row-2\">specializing in<div class=\"about-brief-industry\"><div>Animation,</div><div>Compositing,</div><div>Motion Graphics</div><div>...</div></div></div>', '2014, MFA Computer Art\r\nSchool of Visual Arts, New York', '<p><br></p>\r\n<p><br></p>\r\n<p>Animation allows me to live out my fantasy.</p>\r\n<p><br></p>\r\n<p><br></p>\r\n<p><br></p>\r\n<p><br></p>\r\n<p>真实的自我，和世界拥抱。<br></p>\r\n<p>I believe that we are all different and unique, but there is no distance between us.&nbsp;</p>\r\n<p>我们不一样 但没有分别。</p>', NULL, NULL, '2018-12-26 18:24:47', '2019-01-14 03:32:32', 'f2a0141d-5fcc-4f14-834d-432e38bf54a4'),
