 ('308', '264', '7', '1', 'en_us', '26', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"About Page\",\"slug\":\"about-page\",\"postDate\":1545848687,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"58\":[\"313\"],\"46\":\"Raised in Beijing China, Xiaoxiao now works based in New York, as a freelance compositor and motion graphics artist with brand list including Google, Amazon, Apple, Dell, Samsung, Bosch, Ford, McDonald\\u2019s, ESPN, Nickelodeon, Cartoon Network, Sesame Studios, VH1 TV, Hanes, Footlocker, CVS, Navy Federal Credit Union, etc. Her animated film \\\"Rock is not an Attitude\\\" has been official selected and screened in numerous international festivals, including ANIMAYO International Film Festival, Athens International Film Festival, CutOut Fest, 56th Zl\\u00edn Film Festival, Brooklyn Film Festival, Adobe Design Achievement Awards to name a few. When creating as an independent artist, Xiaoxiao loves stop-motion animation and is particularly interested in its ability to allow a deeper expression based on its direct physical foundation.\",\"57\":[\"311\"],\"47\":\"<div class=\\\"about-brief-text-row-1\\\">Hi, My name is <div class=\\\"about-brief-name\\\">Xiaoxiao Tang<\\/div>, a Multimedia Artist<\\/div>\\r\\n<div class=\\\"about-brief-text-row-2\\\">specializing in<div class=\\\"about-brief-industry\\\"><div>Animation,<\\/div><div>Compositing,<\\/div><div>Motion Graphics<\\/div><div>...<\\/div><\\/div><\\/div>\",\"48\":\"2014, MFA Computer Art\\r\\nSchool of Visual Arts, New York\",\"49\":{\"271\":{\"type\":\"experience\",\"enabled\":\"1\",\"fields\":{\"period\":\"2015-present\",\"position\":\"Compositor and Motion graphics Artist, Freelance\",\"place\":\"Companies include Hornet, Gretel, Mighty Oak, Ghost Robot, Ogilvy & Mather...\\r\\nNew York\"}},\"272\":{\"type\":\"experience\",\"enabled\":\"1\",\"fields\":{\"period\":\"2014\\/9-2015\\/5\",\"position\":\"Compositor, full-time Intern\",\"place\":\"Hornet Inc. New York\"}},\"2